import React from 'react';
import styled from 'styled-components';
import { motion} from "framer-motion";


//logo
import logo from '../assets/PneuS-03.png'

//image 
import mail from '../assets/Mail.png'
import facebook from '../assets/Facebook.png'
import phone from '../assets/phone.png'
import pneus from '../assets/pneus.png'
import commande from '../assets/commandes.png'
import payment from '../assets/payement.png'


const Styles = styled.div`
display:flex;
flex-direction:column;
align-items:center;
height:40vh;
font-size:16px;
.presentation{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    background-color:#eee;
    width:100%;
    height:30%;
    padding: 2% 0;
}
.coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:100%;
    height:70%;
    padding: 0 2%;
    margin-top:1%;
}
.card-coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:35%;
    height:100%;
    margin:0 2%;
    border-radius:10px;
}
.card-col-1{
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    width:25%;
    height:60%;
    background: #fff;
    border-radius:50%
}
.card-col-2{
    display:flex;
    flex-direction:column;
    align-items:flex-start;
    justify-content:center;
    width:73%;
    height:100%;
    padding-left:5%;
}

`;
function underHeader() {
    return(
        <React.Fragment>
            <Styles>
                <div className='presentation'>
                    <p style={{fontSize:'1.2em', fontWeight:'500', color:'#888', marginRight:'0.5%'}}>Le pneu pas cher avec </p> 
                    <p style={{fontSize:'1.2em', fontWeight:'700', color:'rgba(199, 7, 7, 0.85)'}}>Pneuservice</p>
                    <p style={{fontSize:'1.2em', fontWeight:'500', color:'#888'}}>, Leader de la vente en ligne des pneus multimarque en Algérie.</p>
                </div>
                <motion.div 
                   className='coordonnee'
                   initial={{opacity : 0, scale:0}}
                   animate = {{opacity : 1, scale:1}}
                   transition={{ ease: "easeOut", duration: 2 }}
                   >
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={pneus}
                                width="50"
                                height="38"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                            <p style={{fontSize:'1.3em', fontWeight:'600', color:'#999', margin:'0'}}>Je choisis mes pneu</p>
                            <p style={{fontSize:'0.8em', fontWeight:'500', color:'#555'}}>Parmi un large choix</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={commande}
                                width="48"
                                height="44"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                            <p style={{fontSize:'1.3em', fontWeight:'900', color:'#999', margin:'0'}}>Par Email</p>
                            <p style={{fontSize:'0.8em', fontWeight:'500', color:'#555'}}>disponible 7J/7 & 24h/24 <br/>contact@pneuservice.dz</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={payment}
                                width="43"
                                height="40"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                         <p style={{fontSize:'1.3em', fontWeight:'900', color:'#999', margin:'0'}}>0560 66 99 99</p>
                         <p style={{fontSize:'0.8em', fontWeight:'500', color:'#555'}}> Besoin d'un conseil ? <br/> Disponible Du samedi au jeudi de 09h à 18h</p>
                        </div>
                    </div>
                </motion.div>
                
            </Styles>
        </React.Fragment>
    )
}

export default underHeader;

